import React from 'react'
import { useDispatch } from 'react-redux/es/exports';
import { useSelector } from 'react-redux/es/exports';
import { changeController } from '../Redux/Control/changeControlAction';

export default function TicTacToe() {

    const dispatch = useDispatch();

    const state = useSelector(function(state){return state.changeControllerReducer})

    function qq() {
        let x = document.getElementById('q');
        x.disabled = true;
        x.style.backgroundColor = "purple"
        x.style.color = "yellow"
    }


    return (
        <div className='container mt-5 p-4'>
            <div class="row row-cols-3 text-center">
                <button disabled={false} id='q' class="fs-2 btn btn-outline-success col" onClick={qq}>Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
                <button class="fs-2 btn btn-outline-success col">Column</button>
            </div>
        </div>
    )
}
